- input: "TEXT\x1CC00399014\x1CX0\x1C\x1CF3XA\x1CNOTE: Our Common Values PAC does
    not maintain separate offices or staff.    This amended May Monthly report is
    filed in response to your letter dated 6/25/08.  Due to a data entry error the
    the PAC inadvertently reported the 4/4/2008 contribution to Patrick Murphy for
    Congress as a P2008.  It was the intent of the PAC that this contribution be attributed
    to the G2008 election.  This amended report corrects this issue.    Further, the
    PAC made three contributions to Childers for Congress.  These contributions were
    for Primary Debt, the Special General Election (4/22/2008) and the Special General
    Runoff Election (5/13/2008).  The election cycles for these contributions were
    clarified in this amended report.    Please contact the PAC if you have questions
    or would like any additional information."
